import React from 'react';
import { Container, BackgroundImage, Overlay, TextContainer, Title, Subtitle } from '../styled/HeroStyles';
import backgroundImage from '../img/DaonBg.jpg';

export default function Hero() {
    return (
        <Container>
            <BackgroundImage src={backgroundImage} alt="Daon Background" />
            <Overlay />
            <TextContainer>
                <Title>고객의 혁신적 가치와</Title>
                <Subtitle>사람을 중시하는 기업</Subtitle>
            </TextContainer>
        </Container>
    );
}
